<script>
    const scene = new Scene(
        {
            "".containerletras"": {}
        },
        {
            selector: true
        }
    );

    const item = scene.getItem("".containerletras"");

    function move(startTime, endTime, l");
            WriteLiteral(@"eft, top, rotate, scale) {
        item.set({
            [`${startTime}, ${endTime}`]: Scene.kineticFrame({
                left: `${left}px`,
                top: `${top}px`
            }).set({
                transform: {
                    rotate: `${rotate}deg`,
                    scale
                }
            })
        });
    }

    /*
